import React, { Component } from 'react';
import './trailer.css';

class trailer extends Component{

    render(){
        return(
            <section className="trailer-wrapper">
                <video className="trailer" src="dummy.mov">
                </video>
            </section>
        );
    }

}

export default trailer;
